/*Table structure for table `pm_meter` */

DROP TABLE IF EXISTS `pm_meter`;

CREATE TABLE `pm_meter` (
  `id` varchar(50) NOT NULL,
  `areaId` varchar(50) NOT NULL,
  `devicename` varchar(100) NOT NULL,
  `remarks` text,
  `useintype` int(11) DEFAULT NULL,
  `costsId` varchar(50) DEFAULT NULL,
  `createUser` varchar(50) NOT NULL,
  `createTime` varchar(20) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `FK_pm_deviceres$pm_costs` (`costsId`),
  CONSTRAINT `FK_pm_deviceres$pm_costs` FOREIGN KEY (`costsId`) REFERENCES `pm_costs` (`ID`)
