/*Table structure for table `sys_log` */

DROP TABLE IF EXISTS `sys_log`;

CREATE TABLE `sys_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type` int(11) NOT NULL,
  `content` text,
  `username` varchar(50) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
